INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_chapter_title_900002", /*message*/"TV Anime &quot;Love Live! Nijigasaki High School Idol Club&quot; Season 2 Broadcast Special Commemorative Bond Episode");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_1", /*message*/"You and Ayumu, your childhood friend, are out walking around town one day when you&apos;re reminded of a past memory.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_10", /*message*/"One day, at practice, Kasumi becomes passionate about needing some secret, intense training in order to be a match against her powerful rivals, the older Nijigasaki club members.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_11", /*message*/"One afternoon, Ai and Setsuna are concerned after seeing how listless Ayumu appears. Upon asking Ayumu about her woes, what is the answer they receive?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_12", /*message*/"Karin, Kanata, and Emma are hanging out in Emma&apos;s room reading the fan letters they have received from everyone. As they read each and every one, they come across some familiar handwriting.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_13", /*message*/"One day, after a long spell of rain clears up, you just cannot sit still anymore and burst out of your room to head towards the school!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_2", /*message*/"Kasumi is the first to arrive at the clubroom one day. Waiting on her own, she remembers back to when she was the sole person holding down the fort to protect the club.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_3", /*message*/"Setsuna finds herself alone in the clubroom and picks up the practice notebook she kept when the club consisted of only five members. She appears to have regrets about her actions back then.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_4", /*message*/"Ai and Rina have always been good friends, even before joining the club. During a conversation with Ayumu, old memories of Rina are brought up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_5", /*message*/"Emma and Kanata are cleaning the clubroom together when Kanata asks Emma why she is always looking out for Karin.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_6", /*message*/"Rina is the first to show up to the clubroom one day. Left on her own for the first time in a while, she remembers back to a time before she had joined the club.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_7", /*message*/"Today is the day of Kanata&apos;s monthly sweets party! How does Kanata react when Shizuku wants to return the favor for all of the delicious desserts she always makes?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_8", /*message*/"Shizuku suddenly runs off in the middle of practice one day. What does Shizuku do when Kasumi chases after her out of concern?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900001_9", /*message*/"Karin is always receiving help from Emma. She begins to think that it cannot go on like this and moves to be more independent. However, what happens next?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_1", /*message*/"One day after practice, you suddenly ask Ayumu what kind of school idol she wants to be from here on out. You then remember how you asked her the same question once before.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_10", /*message*/"You and Shioriko go to a diner, where she makes you an original drink of hers at the self-service station. It seems that she&apos;s put a lot of thought into this drink...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_11", /*message*/"Mia is writing a new song. You ask her if it&apos;s her new single, but it&apos;s actually for her older sister!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_12", /*message*/"One day, Lanzhu comes along with you to do some shopping at the mall. It seems she&apos;s looking for presents to give to the School Idol Club members.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_13", /*message*/"You are in an extracurricular music lesson, practicing for a school recital. But Ayumu, who&apos;s been keeping her eye on you lately, seems a little concerned.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_2", /*message*/"Kasumi is having trouble coming up with a new recipe for the bread rolls she&apos;s taking with her on her outing with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_3", /*message*/"You&apos;ve been asked for a favor by Shizuku. To your surprise, she wants you to practice volleyball with her!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_4", /*message*/"The magazine Karin appears in as an amateur model wants to publish a column featuring photos of models with their loved ones. Who does Karin pick for hers?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_5", /*message*/"You&apos;re still basking in the joy of Ai&apos;s live show from the day before. How does Ai react when you tell her that she always puts a new spin on what it means to have awesome fun?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_6", /*message*/"You&apos;ve been invited to Kanata&apos;s house. She promises to give you the ultimate sleeping experience.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_7", /*message*/"You call out to Setsuna who is in the clubroom, messing around on her phone. It turns out she&apos;s using a friendship test app!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_8", /*message*/"Having learned about Switzerland in geography class, you ask Emma to teach you about her home country. More than happy to oblige, Emma invites you to her room to teach you more!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_linkage_summary_900002_9", /*message*/"Rina has just finished her new invention, and it&apos;s...a feline translation app?! You and Rina waste no time in testing it out on Fishpuff right away.");
