INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_1", /*message*/"Although she felt down about her student council election loss, Setsuna expresses her true feelings and returns to the club. As everyone gears up to restart school idol activities, Shioriko announces the club&apos;s abolishment.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_10", /*message*/"The midterms are finally over! Despite everyone&apos;s lack of motivation, they follow through with Ai&apos;s recommendation to review their exams. And finally, the fateful day arrives! Will the club survive?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_2", /*message*/"The School Idol Club has been given an abolishment notice by Shioriko. All the club members unify to stand up against Shioriko and stop the club from being disbanded!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_3", /*message*/"μ&apos;s and Aqours also appeal to Shioriko to keep the club active. She tells them that she will allow them to remain on one condition: for the midterms, all of the School Idol Club members must score 60% or above in all subjects!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_4", /*message*/"Science-course students Ai and Rina are tasked to teach Shizuku and Kanata, who are hopeless at science and math. Shizuku and Kanata are suddenly motivated by Ai and Rina&apos;s clear explanations. Now, what about the others...?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_5", /*message*/"μ&apos;s and Aqours decide to share the goal of scoring 60 or more on their midterms and join the Nijigasaki girls in their study sessions. But in true school idol fashion, they don&apos;t miss a day of practice even while studying their tails off!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_6", /*message*/"Hanamaru, Ruby, and Shizuku are tasked with tutoring Emma and Rina in their weakest subject, Japanese. The three tutors are confounded by Emma and Rina&apos;s odd responses. It fans the flames of determination to teach them properly.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_7", /*message*/"Kasumi, Karin, Honoka, Nico, and Kanan form the team that has poor grades overall. Eli, Umi, and Dia struggle to teach these five girls as they come up with reasons to avoid studying. How will they do on their midterms?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_8", /*message*/"The Nijigasaki girls get through their first day of exams. Just as everyone is about to relax after surviving the first day, Ai shows them just how serious she is when it comes to studying.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_10_9", /*message*/"You and Ayumu gather at your place to study together. While you&apos;re enjoying your time studying and chatting with Ayumu, she gets a little jealous after seeing all of the messages you receive from the other girls.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_1", /*message*/"Midterm results are in. The study sessions have paid off and everyone has scored over 60! Since all her conditions were met, Shioriko allows the club to stay active for now. Nobody knows why she&apos;s so harsh towards school idols.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_10", /*message*/"The girls in Uchiura can&apos;t come up with a good slogan and realize how hard it is to run an event. That night, as they brainstorm about what they want to do, a slogan emerges: Come Together, Dream Together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_2", /*message*/"While Shioriko&apos;s intentions remain a mystery, the club decides to keep working hard to gain her approval. Then, the Nijigasaki members receive an invitation from Honoka for a School Idol Festival Executive Committee camp.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_3", /*message*/"The camp is being held in Numazu. Only a select few μ&apos;s and Nijigasaki members get to go. They all party hearty on the way. Meanwhile, Kasumi, Shizuku, and Rina decide to go out and have some fun back in Tokyo.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_4", /*message*/"Kasumi, Shizuku, and Rina have a blast at the aquarium back in Tokyo. Meanwhile, what are the other members getting up to after arriving in Numazu for their camp?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_5", /*message*/"Everyone who has arrived at Uchiura gathers in Chika&apos;s room to discuss the School Idol Festival. Meanwhile, what are Kasumi, Shizuku, and Rina up to after their fun day at the aquarium?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_6", /*message*/"After Kasumi, Shizuku, and Rina enjoy their time at the aquarium and anime shop, they spot Rin, Hanayo, and Nico out in the city and decide to follow them, for some reason. Back in Uchiura, how are the festival discussions going?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_7", /*message*/"Everyone has ideas for what kind of event they want the School Idol Festival to be, but this only adds to the confusion. They decide to think of a slogan first to narrow down a theme. Meanwhile, the sleuths back in Tokyo...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_8", /*message*/"Nico and the others were headed to a school idol live show. Kasumi and the others realize just how much Nico, Rin, and Hanayo love school idols as they watch them cheer, and end up joining in on the fun themselves.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_11_9", /*message*/"After the school idol live show, Nico calls it a day. However, Kasumi and the others decide to continue tailing her to find out just what she has planned afterward. They arrive at a children&apos;s center where they also find Shioriko.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_1", /*message*/"Now that all three groups have agreed on a slogan, the preparations for the School Idol Festival can finally begin! But before that... How do you even run a festival?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_10", /*message*/"The School Idol Festival promo video is finally complete. The time has come to upload everyone&apos;s creation onto the official website!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_2", /*message*/"Running an event is filled with both fun and hard work. During the discussions, someone brings up the School Idol Festival website. How is the public reacting to all of your efforts?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_3", /*message*/"Everyone is hit with the hard truth that the public doesn&apos;t understand their School Idol Festival slogan. Your only chance now is to create a promo video to spread the word and make the slogan clear!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_4", /*message*/"Riko is tasked with writing a new song to spread the word about the School Idol Festival. While everyone is making steady progress, Shioriko appears to be struggling with her student council duties at Nijigasaki High.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_5", /*message*/"Those who are trying their hardest deserve support. You and the club members want to help Shioriko out somehow. After receiving word that Riko&apos;s new song is finished, the club members and μ&apos;s head off somewhere.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_6", /*message*/"The song Riko has written for the School Idol Festival is a masterpiece. Aqours just can&apos;t sit still after hearing the new song and get up extra early for some early-morning practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_7", /*message*/"The μ&apos;s and Nijigasaki girls are fired up after seeing Aqours&apos; early-morning practice. One day, after returning from Uchiura with a renewed passion for the School Idol Festival, you find the whole club looking through your notes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_8", /*message*/"The club members sift through your daily practice notes and reaffirm their desire to give it their all and to stand on stage alongside μ&apos;s and Aqours with pride.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_12_9", /*message*/"You&apos;ve shot the footage of μ&apos;s, Aqours, and Nijigasaki practicing together for the School Idol Festival promo video. Seeing all three groups working as hard as they can reassures you that the performance is going to be amazing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_1", /*message*/"The School Idol Festival is gaining recognition thanks to the idols&apos; promotional video. The Nijigasaki girls are inspired by μ&apos;s and Aqours, but come to a sudden realization.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_10", /*message*/"Shioriko hears how Ayumu feels about the upcoming live show and school idols. The seventh meeting concerning the school tour begins.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_2", /*message*/"The Nijigasaki girls want to put on a live show during the club introduction portion of the school tour. Ayumu and Setsuna attend the club introductions meeting in your place.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_3", /*message*/"At the meeting, the club heads tell Shioriko that they want all interested students to be able to join their club, but for some reason, she is intent on reforming the school.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_4", /*message*/"Shioriko does not want to cancel the school tour, and the members want to put on a live show during the club introductions. They join forces, and Shioriko joins the idol club?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_5", /*message*/"Shioriko joins the school idol club to better understand them. She is bewildered by their personalities but practices hard. The members&apos; opinions of her also begin to change.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_6", /*message*/"The more time the school idol club members spend with Shioriko, the more they want to understand her. You agree to help the student council and talk strategy with Shioriko.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_7", /*message*/"Shioriko will not budge on her club tryouts condition. Convincing the club heads will be tough, but you want to respect her feelings. You begin negotiations.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_8", /*message*/"The members find out there is only time for one song during the club introductions. They all want a shot at a solo performance, but they choose Ayumu to go on stage for them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_13_9", /*message*/"Shioriko cannot understand how the members happily support Ayumu despite wishing to stand on stage themselves. She comes across Ayumu practicing alone and calls out to her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_1", /*message*/"All of the clubs come to an agreement at the school tour meeting to hold the event. The day before the tour, Ayumu puts the finishing touches on her performance. Shioriko approaches you and Ayumu in the clubroom as you practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_10", /*message*/"Shioriko recognizes the club&apos;s passion but still will not approve of the event. She will offer her approval to the club if you can gather one thousand volunteers by the deadline, and you promise to do exactly that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_2", /*message*/"Ayumu practices until the end of the day before the tour. On the day of, all of the club members introduce their club and hand out flyers about the School Idol Festival. μ&apos;s and Aqours also come to help.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_3", /*message*/"The time has come to introduce the club. Ayumu and everyone in the Nijigasaki High School Idol Club wants to share their feelings with the potential students gathered in the auditorium. Spread the word through Ayumu&apos;s performance!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_4", /*message*/"After the huge success of the school tour, you officially offer Shioriko an invitation to join the club. While she declines in order to focus on her student council duties, you realize something from Shioriko&apos;s response!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_5", /*message*/"You suggest to the club members that Nijigasaki High School would be the perfect place to hold the School Idol Festival. First things first, you&apos;ll need to consult Shioriko, the student council president.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_6", /*message*/"Shioriko still finds issues with holding the School Idol Festival and refuses to approve of the suggestion after you consult her. If said issues are resolved, however, then she should offer her approval!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_7", /*message*/"The club has received a steady amount of support from within the school for the School Idol Festival to be held at Nijigasaki. Just then, a formidable helper drops by!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_8", /*message*/"With the help of Honoka and the others, many ideas are put forward for the School Idol Festival. However, some issues still remain that need to be addressed regarding the management of the event.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_14_9", /*message*/"Everyone consults their school&apos;s clubs with the possibility of being able to hold the School Idol Festival if they are all involved. Having solved Shioriko&apos;s apparent issue, you decide to approach her once again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_1", /*message*/"You set a deadline with Shioriko and promise to find 1,000 volunteers by that date in order for Nijigasaki High School to hold the School Idol Festival. To do this, you make a website to recruit these volunteers.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_10", /*message*/"Honoka and Chika ask that the Nijigasaki girls be first up on the main stage, leaving you feeling an even stronger responsibility towards the School Idol Festival. One day, Shioriko asks you to the student council room. What could she want?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_2", /*message*/"The school idol club is overjoyed by the response from people who want to be volunteers, and is excited to make it all the way to the goal of 1,000. Volunteers are coming from Nijigasaki, as well as Otonokizaka and Uranohoshi.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_3", /*message*/"The members of μ&apos;s, Aqours, and Nijigasaki are getting increasingly fired up about finding volunteers to hold the School Idol Festival. Curious about how many volunteers you have, you decide to have lunch in the clubroom.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_4", /*message*/"A thousand people have signed up to volunteer through the website, meaning that you&apos;ve met the goal agreed upon with Shioriko! Her reaction when informed of this is so flat that it&apos;s a bit of a letdown.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_5", /*message*/"Ayumu wants to give you a present. She and Shioriko have fun picking out a gift together. Once the gift&apos;s decided on, Ayumu turns her attention to putting on a great School Idol Festival, but Shioriko seems a little worried.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_6", /*message*/"μ&apos;s, Aqours, and Nijigasaki prepare a volunteer info session. Everyone&apos;s having fun putting together 1000 info packets and is too excited to feel nervous about the session. On the big day, you&apos;re ready to give it your all, but...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_7", /*message*/"1000 volunteers registered on the website, but fewer than 100 actually showed up for the info session. As someone long familiar with the nature of volunteer work, Shioriko feared this would come to pass, and it did.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_8", /*message*/"The info session finished without enough volunteers for the goal, but there&apos;s no time to feel down. The club members are shaken even as they discuss moving forward. You feel the most responsibility out of everyone, worrying Ayumu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_15_9", /*message*/"The club members are concerned as you continue recruiting volunteers all alone. Ayumu talks to Shioriko and decides to give you a notebook filled with messages. After hearing about your situation, Honoka and Chika are worried, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_1", /*message*/"You and Ayumu can&apos;t seem to match up. She worries about you, while you desperately try to round up enough volunteers. As your efforts to gather volunteers do not go as planned, you decide to pay the clubroom a long-awaited visit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_10", /*message*/"Ayumu and you have a heart-to-heart and reconcile. The other club members also drop by and you decide to try to make the School Idol Festival a reality again. Will everyone&apos;s feelings poured into Yume e no Ippo reach the viewers?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_2", /*message*/"The other club members tell you to rely more on them and you finally realize that you have lost sight of what&apos;s around you. Ayumu is not in the clubroom on this day, but it is then that you resolve to tell her how you feel.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_3", /*message*/"Ayumu is feeling down about her argument with you and skips school. Out of concern, Shioriko takes Ayumu out for a change of pace. Meanwhile, you are also wracking your brains over how to reconcile with Ayumu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_4", /*message*/"You and the rest of the club, along with μ&apos;s and Aqours, try to come up with a different way to gather volunteers. You haven&apos;t seen Ayumu since your argument with her, but you happen to see Shioriko at school...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_5", /*message*/"The deadline Shioriko set is fast approaching, but your efforts to gather volunteers aren&apos;t going well. You realize how truly difficult this task is, but time is running out. What happens as you mull over what more you could do?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_6", /*message*/"Despite everyone&apos;s concerns, you stay back alone in the clubroom. Upon reading the messages written in the gift Ayumu tried to give you, you realize her feelings. Meanwhile, how is Ayumu coping with her absence from the club?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_7", /*message*/"Ayumu still thinks about school idols, even during her absence from the club. She is then stunned by how ignorant people are to your efforts and realizes how much she truly wants the School Idol Festival to go ahead.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_8", /*message*/"Shioriko tells Ayumu that the club members have already given up on gathering 1,000 volunteers. After hearing about Ayumu&apos;s resolve, Shioriko suggests that she use a video-sharing website to broadcast her feelings to the world.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_16_9", /*message*/"Ayumu shares her true feelings about school idols, the School Idol Festival, and you over a live stream. How do you react when you watch Ayumu pour her heart out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_1", /*message*/"Ayumu&apos;s live stream helped the club successfully reach 1,000 volunteers offering their help. Tomorrow is finally the day of the School Idol Festival. All the club members coincidentally find themselves on the rooftop.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_10", /*message*/"With the support of all the club members, Shioriko finally joins them as a school idol! The 28 school idols finish their encore performance, closing the curtain on the School Idol Festival.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_2", /*message*/"Everyone reflects on everything that has happened in the club as they look forward to tomorrow. The School Idol Festival is here at last and the curtain rises on the opening act!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_3", /*message*/"You see off the 27 girls as they leave the green room for the opening act of the festival. Shioriko stands beside you as you watch them perform on stage. You ask her about Kaoruko, who you happened to meet earlier.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_4", /*message*/"Everyone at the festival shouts out its slogan in unison to officially open the School Idol Festival. Kanan and Dia are first up on the Event Stage to host the Best of the Bunch School Idol Contest.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_5", /*message*/"Both the dance battle and the test of nerves were fiercely fought. The great battles were filled with smiles all round and featured a winner, loser, and pair that tied. Next up is Aqours&apos; performance!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_6", /*message*/"Honoka and the others watch Aqours&apos; performance and are amazed by how incredible they are. They resolve to rise to Aqours&apos; heights and cheer for them with all their might. After the wonderful show comes a wonderful lunch!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_7", /*message*/"The dishes that Chika, Mari, and Kanata have come up with are all absolutely delicious. The School Idol Festival Food Corner is also a huge success! On the Event Stage, the School Idol Presentation Contest is next on the agenda!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_8", /*message*/"Everyone shares their love for school idols during the School Idol Presentation Contest. While the event continues to run smoothly, Setsuna joins up with Shioriko who is working behind the scenes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_17_9", /*message*/"Kaoruko, one of the founding members of the School Idol Festival, turns out to be Shioriko&apos;s older sister. The School Idol Festival is fast approaching its finale!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_1", /*message*/"You&apos;ve left for a short study abroad program. The members of the Nijigasaki High School Idol Club feel there&apos;s something missing without you around. That&apos;s when Ayumu gets a phone call...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_10", /*message*/"The &quot;Murder on a Deserted Island&quot; prank is getting out of hand, and some are tired of the performance. As they try to wrap it up, however, the true horror begins.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_2", /*message*/"The members of Nijigasaki have decided to do a joint training camp with μ&apos;s. They get a call from Nico about meeting to discuss what they need to prepare.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_3", /*message*/"μ&apos;s and Nijigasaki use Maki&apos;s parents&apos; connections to borrow a house on a remote island for their joint training camp. And now, the day of departure has arrived.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_4", /*message*/"The μ&apos;s and Nijigasaki girls arrive at their remote training camp venue. They drop off their belongings, then run off to enjoy the island to the fullest.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_5", /*message*/"The μ&apos;s and Nijigasaki girls are having the time of their lives playing beach volleyball, swimming in the ocean, and enjoying everything the island has to offer. But, what&apos;s for dinner?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_6", /*message*/"After stuffing themselves at their sunset barbecue, the μ&apos;s and Nijigasaki girls head back to the house. They can&apos;t wait for tomorrow&apos;s practice, so they&apos;re going to go straight to bed...or are they?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_7", /*message*/"Listening to Nico&apos;s ghost story excited some while terrifying others, but no matter what, all of the μ&apos;s and Nijigasaki girls are having a blast. Shouldn&apos;t they get to sleep soon, though?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_8", /*message*/"While talking about their plans for tomorrow on the way back to their rooms, the girls hear a piercing scream. They rush to see what it could be, but they were not prepared for what they saw!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_18_9", /*message*/"Honoka&apos;s body was found in the vacation home on a remote island! Nico and friends jump right into finding the killer, but...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_1", /*message*/"Some of the girls are already terrified and exasperated by Nico and her co-conspirators&apos; prank when everyone is suddenly beset by zombies! They must just be another part of the prank, or so they think.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_10", /*message*/"The fun and slightly heart-pounding training camp comes to a close and the Nijigasaki High School Idol Club members are finally home. While they enjoy talking about this and that, new transfer students arrive on the scene...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_2", /*message*/"Everyone decides to hole up in the house to defend against the zombies. But their only way to contact the outside world is out in the shed! Can they all make it through the night unscathed?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_3", /*message*/"Everyone is totally exhausted from the tense night. They manage to make it to the next morning safe and sound and take a bit of a breather.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_4", /*message*/"Smiles finally return to the faces of the girls at breakfast after checking the area surrounding the house and finding no traces of zombies. Then they attempt to use the radio in the shed to send an SOS to the mainland...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_5", /*message*/"After some careful thought, the girls question if the zombies they saw last night were actually innocent victims who washed up on the island for some reason. They rush to scour the island to provide help, but what do they find?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_6", /*message*/"All signs point to zombies being on the island. The girls want to leave as soon as possible, but the radio and phones are useless, so they must wait until their boat returns. Amongst their fears and panic, night falls once again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_7", /*message*/"After exhausting all other options, the girls hole up back in the house. They try to distract themselves, but the sound of the wind frightens them. Worried that the zombies will return, they decide to keep an eye on the cave.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_8", /*message*/"Once the girls arrive at the cave they see the zombies dancing around a bonfire! Their dance is so fascinating that they must be the nine girls from Nico&apos;s ghost story! Empowered, the girls decide to go dance with the zombies.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_19_9", /*message*/"The curtain falls on the zombie incident, so now everyone can get a good night&apos;s rest. The girls invite Aqours to join them after they finish their promo video shoot and a renewed three-school training camp begins!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_10", /*message*/"With Karin having joined, the Nijigasaki High School Idol Club&apos;s goals and how you&apos;ll reach them are coming together! You then seek out the most radiant former member, Setsuna, but you can&apos;t seem to find her no matter who you ask.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_1a", /*message*/"You&apos;re a second-year high school student at Nijigasaki High School in Odaiba. You go with your classmate and childhood friend, Ayumu Uehara, to Akihabara to hang out. When you arrive...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_1b", /*message*/"By chance you see a broadcast of μ&apos;s and Aqours performing together on one of Akihabara&apos;s big screens. Your first look at a school idol performance leaves you stunned by its shining glamour.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_2", /*message*/"You can&apos;t get the μ&apos;s and Aqours performance you saw with Ayumu yesterday out of your head. You search all around the school grounds, thinking there just might be a school idol at your own Nijigasaki High too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_3", /*message*/"Indeed, there was a school idol at Nijigasaki High! Kasumi, sitting all alone in the clubroom, asks you to help her keep the School Idol Club from being disbanded.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_4", /*message*/"In a fit of passion you go to the student council president about the club being disbanded, and she gives you an ultimatum for its continuation. Forced to find 10 members for the club, you ask Kasumi how things got like this.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_5", /*message*/"Hearing Kasumi&apos;s passionate speech, you decide nothing will stop you from saving the School Idol Club. You rush to the person you trust most as your first step in finding the 10 members the student council president stipulated.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_6", /*message*/"Having secured Ayumu&apos;s place in the club, you and Kasumi head to persuade Shizuku, who left to join the Theater Club. Shizuku performs magnificently in the theater&apos;s spotlight, but what are her true feelings?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_7", /*message*/"Shizuku, wanting to continue as a school idol, returns to the club after training her expressiveness through theater. The next person you go to recruit is someone who truly stands out at Nijigasaki High School: Ai!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_8", /*message*/"Ai joins you in hopes of having some fun, and gets her first-year friend Rina to tag along, too. Your next hopeful is former School Idol Club member Kanata, but there&apos;s a reason she left the club.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_1_9", /*message*/"The members of the School Idol Club now see a thread of hope with the return of former members Kanata and Emma. Your next hopeful is Karin, a popular amateur magazine model! However, she has a very particular stipulation.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_10", /*message*/"Everyone works hard to pull off the guerrilla gig, only to be blindsided when most of the audience leaves to watch the Association&apos;s own pop-up show. The club resolves to work harder and cherish their remaining fans. But then...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_1a", /*message*/"After a productive (?) training camp, the club members return to practice every day while sad about your absence. But! You&apos;re finally back! Who is it that you see on stage when you rush back to school?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_1b", /*message*/"You are overwhelmed by the performance being held in the auditorium and spot an unfamiliar girl on stage. Who exactly is she?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_2", /*message*/"It was the School Idol Association performing in the auditorium?! It seems as though something major has happened while you&apos;ve been away. An enraged Kasumi declares war and tells you all about the shocking truth.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_3", /*message*/"Lanzhu, the chairwoman&apos;s daughter and founder of the School Idol Association, uses her status to prohibit your club&apos;s activities and manages to lure Ai and Karin to the Association! Which is better: the Club or the Association?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_4", /*message*/"Unable to perform otherwise, Karin and Ai defect to the Association while the other members want to stay in the club regardless. Discussions between the two factions are at a stalemate, so you decide to talk to Lanzhu yourself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_5", /*message*/"You go to talk to Lanzhu and are surprised by the facilities she has arranged for the Association. She has also recruited Mia, a composer of global hits. Seeing all of this makes you unsure about what&apos;s best for the club members.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_6", /*message*/"Your concerns deepen when Shioriko tells you that Lanzhu isn&apos;t a bad person. What exactly is best for the club? Amidst all that worrying, meeting up with μ&apos;s and Aqours brings a long overdue smile to your face.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_7", /*message*/"Honoka invites everyone to practice at Otonokizaka after hearing about the situation at Nijigasaki. The Nijigasaki girls are able to practice properly for the first time in a while and vow to take down the School Idol Association.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_8", /*message*/"The club members decide to hold a guerrilla gig to take down the School Idol Association, but there&apos;s no point in a surprise live show without an audience. How will they gather an audience without alerting the school monitors?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_20_9", /*message*/"The club has successfully started secret rumors about their guerrilla gig. Now they&apos;ll finally be able to perform! People are sure to love the club&apos;s performance if they see it. Excitement for the show is skyrocketing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_1", /*message*/"After seeing the School Idol Association&apos;s methods and watching the club&apos;s guerrilla gig, Shizuku decided to transfer to the Association. She regrets leaving on bad terms with Kasumi, however. What do you and Ayumu think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_10", /*message*/"Shizuku performed perfectly for the Association and enchanted all with her ideal self at the guerrilla gig. Both have merits, but the Club resonates with her the most. She is warmly welcomed back after the guerrilla gig.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_2", /*message*/"The day after Shizuku announces her transfer to the School Idol Association, Kasumi still won&apos;t accept it and tries to oppose Shizuku&apos;s decision. They both get heated while Rina watches, leading her to panic!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_3", /*message*/"After her silly quarrel with Kasumi, Shizuku finally heads to the School Idol Association. Ai, Karin, Shioriko, and Lanzhu all welcome her. Shizuku jumps right into practice, but the difficultly astounds her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_4", /*message*/"Since joining the Association, Shizuku seems to have a tough daily training regimen. Thinking you can trust Shizuku to do her best, today you focus on reviving the club with the other members. But who do you meet at lunch?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_5", /*message*/"Fans keep coming to gigs despite the ban on the club&apos;s activities. Every show boasts a full and enthusiastic audience. The members think about why that is. Meanwhile, is Shizuku finally going on stage with a solo song?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_6", /*message*/"At the Association&apos;s show, Shizuku put on a better performance than ever. She rushes over to you and Kasumi afterward and they quarrel again. Kasumi will prove that there is something Shizuku doesn&apos;t understand at the next gig.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_7", /*message*/"Shizuku is shaken by Kasumi&apos;s guerrilla gig performance. There really was something she didn&apos;t understand but Kasumi did. After a sleepless night, Shizuku heads to the Association early.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_8", /*message*/"Mia and Lanzhu entrust Shizuku with a song that takes full advantage of her expressiveness. She normally would&apos;ve been excited, but Kasumi&apos;s show from yesterday has her head in a fog. Troubled, Shizuku decides to pay you a visit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_21_9", /*message*/"After talking with you and remembering her roots, Shizuku comes to accept that Kasumi has something she doesn&apos;t. So with her head clear, what does Shizuku do after performing the song she got from Mia and Lanzhu?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_1", /*message*/"Shizuku returns to the School Idol Club from the Association. She learned a lot. But now, something&apos;s different at the School Idol Association. Mia used to write songs at breakneck speeds, but nobody has seen her lately.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_10a", /*message*/"Rina proposes that the next guerrilla gig should be streamed online. The other Club members pitch in with their ideas to make the live show more exciting. It&apos;s decided that Mia should be a part of this live show, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_10b", /*message*/"Mia sings the song she wrote, as a special guest at the Club&apos;s online live show. Everyone hears her singing voice for the first time and is amazed at what they hear.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_2", /*message*/"The Club receives feedback about their guerrilla gig. All those likes have given everyone confidence. Meanwhile, the Association is worried about Mia&apos;s recent disappearance. She seems mature for her age, but she is still a child.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_3", /*message*/"Lanzhu drags Mia out of hiding to hear Mia&apos;s new song. It&apos;s a polished, high-quality song, but Lanzhu rejects it and demands something better. Mia goes back into hiding to create music that will blow everyone away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_4", /*message*/"The school monitors have been less strict lately, so the Club decides to do more guerrilla gigs. Wanting to improve, they watch videos of the Association&apos;s live shows. Everyone is very impressed, but Rina is not so sure.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_5", /*message*/"The Club members go to cheer on Aqours at their live show. There, they learn that Mia is from an internationally famous musical family. When Rina returns to school, she finds Mia collapsed from hunger, and gets to know Mia better.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_6", /*message*/"The Club&apos;s guerrilla gigs are attracting more and more people who share their positive feedback over social media. Mia leaves a negative comment and gets distracted by the Club, though the Association has a live show coming up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_7", /*message*/"Feeling pressured by the Club&apos;s success, Lanzhu is unhappy about the Association&apos;s live shows. She blames Mia for not writing a new song yet. Mia says she&apos;ll write it, but disappears shortly thereafter. Ai and the others worry.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_8", /*message*/"As a favor to Ai, the School Idol Club searches for Mia, too. Rina, who helped Mia when she was hungry, thinks she knows where to search. There, she learns about Mia&apos;s past.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_22_9", /*message*/"Rina found Mia, and they had a heart-to-heart talk. Afterwards, Rina comes up with an idea to help a burned-out Mia enjoy music again. Rina&apos;s idea could potentially also solve the Club&apos;s recent problems.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_1", /*message*/"Both the School Idol Club and School Idol Association are going strong. Mia has gotten over her blues and is back to her usual self, and Ai reflects on how she has been feeling lately.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_10", /*message*/"Ai and Karin renew their competitive spirit at their mini-camp. Ayumu, Kanata, and Emma host a public tournament draft where everyone draws a number to determine their opponent. The tournament will be in a week!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_2", /*message*/"Ai accepts her new feelings, and Lanzhu demands ideas for ways to show that the School Idol Association is far superior to the School Idol Club. Something new is in the works as Shioriko goes to visit the School Idol Club.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_3", /*message*/"Feeling at home in the Association, Ai and Karin are impressed anew at Lanzhu and Setsuna&apos;s talent. Lanzhu and Setsuna may be polar opposites on stage, but are both so unique. What&apos;s Ai&apos;s daily life like, with those two in mind?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_4", /*message*/"Ai reaffirms her desire to compete against the School Idol Club and win. She has a great idea to accomplish what she wants as well as Lanzhu&apos;s request, and calls a meeting with both the School Idol Club and the Association.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_5", /*message*/"Ai proposes a tournament-style live show event pitting the School Idol Club against the School Idol Association. The Association is all for it, but how does the Club feel?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_6", /*message*/"Setsuna, Kasumi, Shizuku, and Rina agree to participate in the joint event, and Ayumu, Kanata, and Emma will assist. Not wanting the Association to do all the prep work, the Club members head straight over to help after practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_7", /*message*/"Ai&apos;s idea of doing a joint live show event with both the Club and the Association is taking shape! Everyone is assigned their tasks, and some friendships have even started to change.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_8", /*message*/"Preparations for the joint event that was Ai&apos;s idea are going smoothly. Everyone&apos;s emotions are running high about the event. Amidst the tension, Karin tries to talk to Emma, but it doesn&apos;t go as planned.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_23_9", /*message*/"Karin consults Kasumi about her strained relationship with Emma. Karin decides that all she can do is show Emma an outstanding performance. As the joint event draws near, Ai asks to do a mini-training camp with only Karin.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_1", /*message*/"The match-ups for the joint event produced by Ai are: Rina vs. Ai, Shizuku vs. Lanzhu, Kasumi vs. Karin, and Setsuna vs. Shioriko. While the day&apos;s bound to be packed with heated battles, the morning starts out quietly enough.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_10", /*message*/"The final showdown was Setsuna vs. Lanzhu. The School Idol Club pinned their hopes on Setsuna, while Lanzhu planned to do things her way as usual. And the winner was...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_2", /*message*/"The joint event produced by Ai has begun! The first performance of round one will be Rina vs. Ai! Rina has a secret plan for going up against Ai.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_3", /*message*/"Round one started with Ai securing victory in her match versus Rina. The next match will be Shizuku vs. Lanzhu. Shizuku quit the Association, and is now taking on their leader, Lanzhu!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_4", /*message*/"Ai beat Rina in the first match of round one, and Lanzhu beat Shizuku in the second. The third match of this round will be Kasumi vs. Karin. Who will win in a battle of completely opposite personalities?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_5", /*message*/"Round one took place in the morning. During the lunch break before the next round, the School Idol Club goes over what happened in the first half of the day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_6", /*message*/"Lanzhu and Mia visit the School Idol Club at lunchtime, then after enjoying themselves a bit they head back to their clubroom to prepare for the afternoon. Mia thinks it&apos;s odd that Lanzhu, with her high standards, doesn&apos;t mind being in an amateur student event.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_7", /*message*/"Time for the afternoon session! First up for round two is Setsuna vs. Ai. Ai&apos;s wish to compete against Setsuna finally came true. She even switched to the Association to train herself to the max. Is she a match for Setsuna now?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_8", /*message*/"In the first match of round two, Setsuna vs. Ai, Ai took advantage of her natural charm and pro stage effects. But Setsuna was the complete opposite, expressing who she is without flashy dances or effects. Which won out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_24_9", /*message*/"Ai and Setsuna&apos;s match ends with them praising each other&apos;s performances, but who will claim victory in this heated competition once the final round has arrived?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_1", /*message*/"The joint event organized by Ai came to a successful end and Lanzhu won. Despite varying results, everyone involved is satisfied with how they thrilled the crowd with their wholehearted performances. Karin feels otherwise.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_10", /*message*/"Karin&apos;s live show with her true emotions on display is a huge success. After seeing the bold performance of a powered-up Karin, you reaffirm yourself as a fan of hers. As normality returns for Karin, big news hits everyone!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_2", /*message*/"You and Setsuna head over to the student council room one afternoon following the joint event to ask Shioriko about broody Karin. As you help with student council work and find out about Karin, Satsuki and Uzuki return.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_3", /*message*/"Practicing with Lanzhu makes Karin realize how polished Lanzhu is—but her level is attainable with enough practice. Because Lanzhu won the joint event, Karin is convinced further that her methods are right. Her obsession deepens.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_4", /*message*/"Emotions run high and Karin drives Emma away despite her visiting out of concern. Unable to understand why she did that and got so emotional, Karin&apos;s regret and confusion lead to her skipping school. Who then comes to her?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_5", /*message*/"Emma frets over hurting Karin. She&apos;s at a loss because she believes she could have worded things better, but can&apos;t ever lie or hide the truth from Karin. What does Kanata say to Emma upon seeing her like this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_6", /*message*/"Kanata now understands Emma&apos;s passion for school idols and how she feels about Karin. She decides to roll up her sleeves for the two of them. How does Kanata decide to work her magic?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_7", /*message*/"Karin and Kanata enjoy themselves at Haruka&apos;s live show. Watching the live show has made Karin realize that she has perhaps been self-conceited. The shame makes her want to be left alone, but Kanata decides to take her somewhere.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_8", /*message*/"Karin is brought to a park by Kanata where she watches Emma perform a live show. She is brought to heart-wrenching tears by Emma&apos;s gentle, comforting voice as she sings surrounded by children. Emma then warmly embraces Karin.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_25_9", /*message*/"Karin, Emma, and Kanata talk to each other after Emma&apos;s live show in the park. They chat about their ideals and aspirations, respectfully disagreeing at times. Now that she&apos;s come to a realization, what will Karin do next?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_1", /*message*/"Kaoruko, the founder of the School Idol Festival, has come to Nijigasaki! What does she have planned? And what&apos;s going on between her and Shioriko?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_10", /*message*/"After talking things over with everyone, you successfully write songs for each unit. Today is the last day of the joint training camp. It looks like a feast was prepared to wrap things up, but there&apos;s one last thing...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_2", /*message*/"Big news! Kaoruko is planning a new major event. School representatives will be chosen through school auditions, leveling the playing field for the Club and Association members. Everyone begins preparing for the auditions.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_3", /*message*/"The Club members learn of Kaoruko&apos;s new event. This competition is an opportunity for everyone to prove themselves after any bitterness from past events, and everyone is really motivated. You help Kaoruko prepare for the event.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_4", /*message*/"On Kaoruko&apos;s orders, everyone goes to a training camp. Everyone is eager to level up their skills. The training camp is being held at a place that looks kind of familiar...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_5", /*message*/"It&apos;s the first night of the joint training camp on a deserted island, and everyone&apos;s exhausted from Kaoruko&apos;s rigorous training regimen. But everyone has to do the cooking and cleaning, too. First, they attempt to make dinner...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_6", /*message*/"It&apos;s the first night of the joint training camp on a deserted island. Everyone was blown away by Ai and Karin&apos;s impressive performance earlier, and they are now deciding whether to go solo or try something new themselves. What did Emma decide?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_7", /*message*/"It&apos;s the first night of the joint training camp on a deserted island. Everyone was blown away by Ai and Karin&apos;s performance earlier. In the middle of a conversation with you, something pushes Ayumu to make a decision. What is her idea?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_8", /*message*/"You agree to write songs for Emma&apos;s four-person unit and Ayumu&apos;s three-person unit. You&apos;ve only ever written for individual singers, so you&apos;re having difficulty for the first time. You take a walk to clear your head.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_26_9", /*message*/"You&apos;re having difficulty writing songs for the units. You try to clear your head, then attempt to sleep it off, but you&apos;re still stuck. Mia notices you and might have some advice to offer.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_1", /*message*/"The Association and School Idol Club&apos;s joint training camp is over, and each temporary unit now hones its performance skills in anticipation of the school auditions. Meanwhile, Shioriko feels suffocated with Kaoruko back home.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_10a", /*message*/"It&apos;s finally the day of Shioriko&apos;s live show and Kaoruko is brought to the auditorium. Up on stage, Shioriko starts telling stories about her big sister and their colorful past together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_10b", /*message*/"After years of bottling up her feelings, Shioriko has left what she could never express to her sister out on the stage. What does Kaoruko feel after the show?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_2", /*message*/"Life with Kaoruko back at home has thrown Shioriko for a loop, while laid-back Kaoruko has begun working as a trainee teacher. What kind of lesson does Kaoruko have in store for her students?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_3", /*message*/"Student council secretaries Satsuki and Uzuki draft up a perfect plan for school idol Shioriko, who puts her all into practicing to make it a reality. But the appearance of a certain duo dampens her enthusiasm.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_4", /*message*/"Kaoruko crashes the School Idol Association&apos;s practice and joins in with Lanzhu to give nonstop advice to Shioriko, which sends her running to the Club. There she sees Kanata and Haruka, a very close pair of sisters.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_5", /*message*/"After escaping to the Club, Shioriko sees how close Kanata and her younger sister Haruka are. She and Kaoruko are so different that it confuses her. To cheer her up, everyone with a sister meets up at a diner on their day off.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_6", /*message*/"At the diner, Shioriko hears about warm sisterly bonds and learns that relationships between sisters come in all shapes and sizes. She is invited to Kanata&apos;s house, where she meets her sister Haruka and has a delicious dinner.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_7", /*message*/"At a sleepover at Kanata&apos;s house, Shioriko sees Kanata and Haruka&apos;s sisterly love up close. She realizes that she has a way to communicate the feelings she&apos;d given up expressing to Kaoruko. She heads home ready to speak her heart.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_8", /*message*/"Shioriko is tired of Kaoruko not listening to her and wants to do a live show to tell Kaoruko how she feels. When she comes to you for advice, you suggest getting the Association involved and start coming up with her song.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_27_9", /*message*/"An intense song that expresses all of Shioriko&apos;s bottled-up feelings is finally complete. Next up is discussing choreography, stage effects, and other details for the live show. But Lanzhu&apos;s ideas are all too out there.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_1", /*message*/"Shioriko&apos;s live show was a success, and her strained relationship with her sister Kaoruko has started to show signs of improvement. But why wasn&apos;t Lanzhu at the live show?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_10", /*message*/"The girls run after Lanzhu and finally arrive at the airport, despite the present bad weather. Unfortunately, Lanzhu&apos;s airplane has already taken off.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_2", /*message*/"Lanzhu has made up her mind. Unaware of this, the Association members resume practicing for the school auditions. Their practice is interrupted when some unexpected news arrives.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_3", /*message*/"Lanzhu has abruptly declared that the Association will disband. Unable to contact her, its flustered members ask the Club for help. They realize they don&apos;t know anything about Lanzhu. What kind of girl is she at heart?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_4", /*message*/"Shioriko and the girls search for Lanzhu while she roams the streets. She looks up and sees a diner. Before starting the School Idol Association, they came to this diner to discuss the future and envision what might happen.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_5", /*message*/"Lanzhu has decided to disband the Association and return to Hong Kong. She even stops attending school but puts on one last live show for herself. The girls who know about the live show rush to see her. What will they witness?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_6", /*message*/"The girls watched Lanzhu&apos;s last show and got to hear her true feelings and voice as a school idol. It strengthens their desire to perform with her even more. But then they hear the shocking news—Lanzhu is returning to Hong Kong!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_7", /*message*/"The members talk with the chairwoman and decide to stop Lanzhu from leaving. What secret plan has Mia thought up to change Lanzhu&apos;s mind?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_8", /*message*/"Mia has a secret plan to stop Lanzhu—a song for the three School Idol Association founders, symbolizing a new start. She&apos;s using a different composition style to write it, so Mia asks you all to share your memories of Lanzhu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_28_9", /*message*/"Lanzhu didn&apos;t listen to the new song made for her, Mia, and Shioriko. The girls grow tense when they can&apos;t find or reach her. Then they hear that she&apos;ll return to Hong Kong that same day. What&apos;ll become of her—and the new song?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_1", /*message*/"You and the Club members watched Lanzhu, Mia, and Shioriko&apos;s performance together. Spurred on by the trio&apos;s overwhelming enthusiasm, nobody can contain their excitement! The Club members rush over to congratulate them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_10", /*message*/"After you hear how everyone feels, you realize that your supportive efforts also count as school idol activities. You feel much better. And finally, the school auditions begin! Some visitors from other schools are watching, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_2", /*message*/"After the live show with Mia and Shioriko, Lanzhu&apos;s got something on her mind. She just doesn&apos;t understand you, like when you ran straight over to hug her after their live show. She&apos;s been mean to you, so why do you keep smiling?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_3", /*message*/"After speaking with Ayumu, Lanzhu has become even more curious about you. Not being the type to sit still, she quickly comes to see you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_4", /*message*/"After speaking to you and Ayumu, some things have become clear to Lanzhu. She organizes a live show to confirm her hunch. The venue is packed. Sharing a renewed bond with the Association girls, what does she see from up on stage?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_5", /*message*/"Lanzhu has realized what&apos;s important to her as a school idol and decides to disband the School Idol Association. She goes to visit the Club members with a renewed attitude and makes an announcement.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_6", /*message*/"Lanzhu and friends have officially joined the School Idol Club! The group has restarted anew. Together, everyone sets their sights for the School Idol Exhibition auditions. However, something has been on your mind.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_7", /*message*/"The Club members start preparing for the school auditions again. Even though each unit is performing, everyone discusses plans together. The best parts of the Club and Association are shining. However, something is bothering you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_8", /*message*/"Why don&apos;t you want to participate as a school idol? Do you not like school idols as much as the others? You open up to Ayumu about your concerns. Ayumu then invites you for a sleepover and wants to talk about the past.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_29_9", /*message*/"Hearing Ayumu&apos;s strong feelings, you start feeling hopeful about what being a school idol means to you. The next day, you go to the clubroom to ease your doubts, but you find all of the members waiting for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_1", /*message*/"Who would have thought that Setsuna Yuki was actually the student council president?! With 10 members including you, the Nijigasaki High School Idol Club has officially restarted and is ready to move step by step to the next goal!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_10a", /*message*/"In the end, Nijigasaki&apos;s members perform separately. The group lessons everyone took helped them level up, though. Now, the event with the main stage of the School Idol Festival riding on it is finally tomorrow!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_10b", /*message*/"At last, the girls have won a spot on the main stage of the School Idol Festival through hard effort! Is everyone ready?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_2", /*message*/"The members of the club decide to gain some experience at an event in order to hit the main stage at the School Idol Festival. Everyone trains hard, but something is amiss with Emma.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_3", /*message*/"Being surrounded by nature like that of her native Switzerland, Emma remembers what&apos;s special to her. Meanwhile, Ai works to get her signature puns to make the rather inexpressive Rina laugh. Even Ayumu is trying puns.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_4", /*message*/"You find Ayumu&apos;s willingness to take on a challenge inspiring after seeing her succeed in making Rina laugh with a pun. Meanwhile, Karin questions Setsuna about her feelings on school idols.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_5", /*message*/"Karin is spurred on by Setsuna and gets down to training like never before. Then, the big day finally arrives! What will the second coming of the Nijigasaki High School Idol Club be like?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_6", /*message*/"Shizuku and Setsuna come out on top at the event. The winner of the next event will get to appear on the main stage at the School Idol Festival! But you have something else on your mind after seeing everyone&apos;s first performances.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_7", /*message*/"After deciding, on your suggestion, that the School Idol Club perform as a group in the next event, everyone meets and discusses how to be their brightest, most appealing selves every day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_8", /*message*/"After much practice and discussion, the club has begun to pull off some great performances. Seeing everyone&apos;s beautiful dancing and hearing their beautiful singing, you...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_2_9", /*message*/"You realize your mistake. The dancing and singing don&apos;t reflect Nijigasaki. You can see how your idea put everyone in a tough spot. What makes Nijigasaki what it is, is everyone&apos;s unique individuality!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_1", /*message*/"The School Idol Exhibition auditions brought much excitement to Nijigasaki, giving you confidence in your school idol love and efforts. You reflect on the past. Despite all of the setbacks, overcoming it all has been so exciting!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_10", /*message*/"The Club announces to Kaoruko the chosen Nijigasaki representatives. She&apos;s shocked that it isn&apos;t any of the units from the school auditions. You all then show her the performance that will represent Nijigasaki. How does she react?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_2", /*message*/"As Lanzhu settles into the new School Idol Club, she feels there&apos;s still some distance between herself and Kasumi in particular. She asks to be spoken to with respect and love. How do the other members respond?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_3", /*message*/"As the school audition continues to gather votes, the members take a look at the opinions of those who have already voted. They begin to find that a common thread runs through all of the comments.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_4", /*message*/"Your internal conflict has subsided, but you don&apos;t want any lone group to win since you love everyone! You decide to write a song filled with the feelings of school idol fans and seek out insight from others inspired by school idols.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_5", /*message*/"You seek out the thoughts of school idol lovers for research. Misato tells you many things you never knew about Ai. Returning from hearing of Satsuki and Uzuki&apos;s passion towards Shioriko, you run into Setsuna by chance.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_6", /*message*/"You&apos;ve been interviewing many people for your songwriting. When you mention speaking to Mai, Emma suggests taking a commemorative photo at the Natsukawa Photography Studio. You all decide to take one as the new School Idol Club!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_7", /*message*/"You have visited Mai&apos;s photo studio and heard many thoughts from school idol lovers. Many people have responded to your online plea for letter submissions. You share the sentiments found in every one of them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_8", /*message*/"Your songwriting is going well thanks to help from the Club members. You are elated by the words Misato and everyone shared with you, knowing they share your passion. Ayumu watches over as something still troubles you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_30_9", /*message*/"Hearing your song, the Club decides that it must be their School Idol Exhibition song. Everyone braces for disqualification as they infringe on the event&apos;s rules. Despite this, you all give it everything to express your feelings.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_1", /*message*/"With the addition of Lanzhu and Mia, the School Idol Club is now livelier than ever. You arrive at the clubroom intending to do your best again today when Lanzhu suddenly calls out to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_10", /*message*/"The Club members head home after their day of shopping, eating, and singing. Lanzhu watches from behind with a smile as the other girls chat away with glee. Then, you offer your thanks to Lanzhu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_2", /*message*/"All of the School Idol Club members gather and start their practice sessions. Everyone&apos;s motivation suddenly lifts upon seeing Lanzhu&apos;s elite-level training up close, yet this leads to an unexpected problem.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_3", /*message*/"Lanzhu&apos;s practice weighs on the School Idol Club members&apos; minds and throws everyone out of rhythm. You seek out Lanzhu for advice, so you can both make a new School Idol Association-style training regimen for the Club girls.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_4", /*message*/"The intense training wipes the girls out. Lanzhu flips through her practice notebook, confused as the training was customized to suit everyone&apos;s levels. It just so happens to be the practice notebook that she showed you before.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_5", /*message*/"Everyone heads out to a shopping mall after learning about the wishes written in Lanzhu&apos;s notebook. Lanzhu is excited to hang out with everyone. Mia keeps her usual cool but joins in on the shopping fun for the sake of the Club.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_6", /*message*/"After having fun shopping to their hearts&apos; content, the club members joyfully share stories about their shopping experiences and what they bought. Where do the girls decide to go to next?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_7", /*message*/"The girls drop by a diner on the restaurant floor for a break and some food. While everyone has fun eating, Kasumi returns with original drinks concocted at the self-service station. How do the curious-colored drinks taste?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_8", /*message*/"The gang head over to a karaoke place after their meal. The session kicks off with a fight over the microphone and who gets to go first. As the fun ruckus continues, Lanzhu reveals her dissatisfaction.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_31_9", /*message*/"The School Idol Club members start to get hungry after belting their lungs out at karaoke. Ai suggests that everyone head over to her family&apos;s monjayaki restaurant. Lanzhu and Mia try out their first-ever monjayaki!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_1", /*message*/"The rest of the Club members have grown closer to Lanzhu and Mia. Everyone has been building their skills and stamina for the Exhibition promo video, but ideas escape them. If discussions don&apos;t work, then it&apos;s time to search outside!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_10", /*message*/"Rin arrives at the answer she needs after confronting her anxieties. Honoka has an epiphany of her own after witnessing her friend&apos;s triumph.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_2", /*message*/"You decide to volunteer for the school idol fansite&apos;s campaign as a way to gather promo video ideas. The project you are tasked with involves μ&apos;s. What happens on your long-overdue revisit to Otonokizaka?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_3", /*message*/"The school idol fansite&apos;s &quot;Ask μ&apos;s&quot; project is now underway. No sooner than submissions for emails open, the girls are flooded with a veritable ocean of them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_4", /*message*/"The μ&apos;s girls start going through the emails sent through the fansite. Each sender has a great weight on their shoulders, and the girls take each problem on as if it were their own.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_5", /*message*/"Ayumu, Shioriko, and you join Honoka and the others for some arcade fun on your day off. The Nijigasaki girls regale μ&apos;s with all that has happened, telling them that the Club is having lots of fun. However, Honoka seems slightly down today.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_6", /*message*/"μ&apos;s is proceeding smoothly with the pile of emails they received, although a few emails leave them stumped. One day, you visit Otonokizaka only to find that everyone is absent, except for Maki.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_7", /*message*/"Maki racks her brain for a reply to send to a girl who wants to become a manga artist, whose circumstances remind Maki of her past. She shares her worries regarding the task with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_8", /*message*/"Answering the emails sent to μ&apos;s&apos; advice column continues in good form. You bring a draft of the article featuring the replies to Otonokizaka. There, you find Rin fretting over a particular email.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_32_9", /*message*/"Rin is shocked by an unexpected remark. You go after her with Hanayo to offer her some support, and a scene unfolds before you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_1", /*message*/"The fantastic reception of μ&apos;s&apos; advice column brings more emails to the girls. However, they still haven&apos;t made much progress on the promo video as they find it difficult to pick one song when they hold them all so dear.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_10", /*message*/"The Nijigasaki girls chatter excitedly about how μ&apos;s have inspired them to get to where they are after watching the promo video on the School Idol Exhibition site. μ&apos;s truly are powerful, but you can&apos;t let them take the lead!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_2", /*message*/"You visit the your club for the first time in a while. All the members have been doing their own practice in your absence. On a whim, you ask each of them why they like school.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_3", /*message*/"The μ&apos;s girls busy themselves with the other emails as they continue to mull over the question of why they like school. They find one whose writer wants to know how she can be as cool and mature as Eli.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_4", /*message*/"Eli is the very image of perfection at school, but Nozomi insists that there is more to her charm. On her suggestion, the girls tail Eli on her day off! Can they reveal the secrets to Eli&apos;s charms with this top-secret mission?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_5", /*message*/"After seeing the success of the fansite campaign, Nico declares that this is prime time for her to write the best replies and guarantee her place as the most popular member! Her first consulter is...Honoka?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_6", /*message*/"Honoka and the others learn of a new side to Nico&apos;s passion. She ends up milling about in a park, too restless to go home, before discussing her new revelation with her friends.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_7", /*message*/"The μ&apos;s girls finally find their answer to the email and decide on a song. Now they commit to making their promo video and transforming one of their old favorites into an even more precious and one-of-a-kind song!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_8", /*message*/"The promo video is finished at last, complete with all of μ&apos;s&apos; sentiments and the special song that started it all. You watch the final product and become overwhelmed by its display of μ&apos;s&apos; past, present, and future.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_33_9", /*message*/"μ&apos;s finally uploads their emotion-charged promo video to the School Idol Exhibition site. Can their passion reach the girl who wrote the email?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_1", /*message*/"The school idol fansite has decided to run a campaign for Aqours. You head over to Uchiura to tell them the news, but who greets you when you arrive at the clubroom?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_10", /*message*/"The third years are victorious at the contest in Tokyo. They return to the rest of Aqours with their now-fulfilled dreams in tow. Everyone goes back to their daily lives, but something seems ever-so-slightly different.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_2", /*message*/"You and Aqours go to Chika&apos;s place to have a chat. You explain to them that you&apos;ve come to Uchiura because the school idol fansite has a feature they want Aqours to do. What exactly is it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_3", /*message*/"The girls decide to push ahead with the Aqours Challenges. After discussions, the rest of the girls leave while you and You stay the night at Chika&apos;s. You wake up that night to find that Chika isn&apos;t there. Where has she gone?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_4", /*message*/"Chika has decided on her Aqours challenge—she wants everyone to declare Aqours&apos; promo video to be the best! After talking about the Aqours Challenges at school, everyone gets excited and offers to help spread the word.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_5", /*message*/"Aqours is surprised but inspired by Chika&apos;s announcement for the Aqours Challenges. They feel as though they need to power up for her challenge and focus more on practice. What does Hanamaru think upon seeing all of this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_6", /*message*/"Hanamaru goes to Tokyo for her challenge to power up as a school idol. Rin tells her that she should improve on what she&apos;s good at instead, leaving her confused. She tells you about it when she sleeps over at your place that night.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_7", /*message*/"The Aqours girls continue their intense training to clear Chika&apos;s suggested Aqours challenge. On their first day off in a while, the third years gather in Mari&apos;s room for some secret talks.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_8", /*message*/"The third years find their own Aqours challenge. They decide to carry out some secret training after their daily practice. Smiles spread across their faces despite the grueling training.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_34_9", /*message*/"Mari, Dia, and Kanan go to Tokyo on the day prior to the school idol contest to prepare. They drop by Nijigasaki where all the third years chat up a storm. What do the three Aqours girls get up to on the night before the contest?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_1", /*message*/"After seeing Hanamaru and the others&apos; Aqours Challenges, Chika is getting more and more motivated. She stays up late to research μ&apos;s in order to make a promo video that people will say they like the most.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_10", /*message*/"Now that they&apos;ve picked the song to use for their video and resumed their rigorous training, production is going smoothly for the Aqours promotional video. What happens when it&apos;s finally complete?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_2", /*message*/"Seeing the others succeed in their own challenges one after another, Yoshiko is determined to find her own. She discusses it with her little demons in her usual live stream, but what suggestions do they have for her?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_3", /*message*/"Yoshiko participates in the Numazu Walk Rally in order to get a statue of the Goddess of Fortune. The strength she built up from training gave her a good leg up, but misfortune follows wherever she goes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_4", /*message*/"The day after Yoshiko successfully completes her Aqours Challenge by obtaining the goddess statue, Aqours receives an unexpected public relations request.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_5", /*message*/"Aqours are appointed as the promotional ambassadors for Izu Mito Sea Paradise. Ruby becomes the leader and works hard to prepare for the event. Then her first day of helping as an ambassador arrives!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_6", /*message*/"Though Aqours had some troubles on their first day as promotional ambassadors, they soon got used to their roles. One day into the second half of the month-long project, you hurry over to see how things are going at Mito Sea.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_7", /*message*/"You decide to check up on Aqours again in Uchiura while they are making progress on their challenges. What do you hear when you begin to interview them more deeply?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_8", /*message*/"Many messages arrive from people who have been following the Aqours Challenges. Among them is a letter from a small group who started a school idol club because of Aqours. What memories does the letter evoke?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_35_9", /*message*/"After recalling their joint live show with μ&apos;s, Aqours grasps the direction of their own promo video. As soon as they put out a request for contributions on the website, they get a ton of responses! What do they all say?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_1", /*message*/"After being inspired by watching Aqours&apos; promo video, you have been completely devoted to creating articles for the school idol fansite every night. What happens when Ayumu discovers this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_10", /*message*/"All of the clubs have officially agreed to appear in the promo video for the School Idol Exhibition! You and the School Idol Club members now have the task of going to teach each of the clubs the choreography.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_2", /*message*/"Nijigasaki has finally received a campaign request of their own from the school idol fansite! What does their column entail?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_3", /*message*/"The first-years have been gathering in the student council room before practice recently. What exactly are they up to?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_4", /*message*/"In an unexpected turn of events, the first-years get hooked on Uzuki and Satsuki&apos;s yoga lessons. In fact, Kasumi even gets up to some yoga at home while she&apos;s on the phone with Shizuku.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_5", /*message*/"Shizuku has flashbacks to when she first joined the School Idol Club while on the phone with Kasumi. She had only one reason to join the club—to improve as an actress. How does she feel now?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_6", /*message*/"The first-years have chosen &quot;beauty&quot; as what they&apos;re currently obsessed with. Today, they have all headed off to the shopping mall to film their video. What is it that they&apos;re after?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_7", /*message*/"The first-years have finished filming their introduction to beauty. Rina is in her room trying out what she&apos;s bought. She&apos;s had many firsts since becoming a school idol. What does she remember through trying her new makeup?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_8", /*message*/"Shioriko has been mulling over what you mentioned about the girls reevaluating their roots. However, she feels as though she didn&apos;t exactly have a starting point of her own.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_36_9", /*message*/"After concluding that the video of them choosing cosmetics was not enough, the first-years decide to film one more video. What will their next topic be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_1", /*message*/"The second-years are wild about the great outdoors. Ai, who&apos;s helping out at other clubs, made some friends and got so excited about camping that it spread throughout the second-years. They meet today to shop for a future trip.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_10", /*message*/"Everyone in Nijigasaki is so radiant, and you want to make a video with them all in the spotlight! But how? And it seems that Ayumu has noticed you worrying over this problem...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_2", /*message*/"On the night after the shopping trip, the second-years still want to chat more. They hold a voice call where Setsuna announces her newfound camping expertise.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_3", /*message*/"Each club gradually adds the dance videos requested by the committee to the pile. The passion for dancing in each clip is palpable, but what do the members think after they watch them?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_4", /*message*/"It&apos;s the long-awaited day of the camping trip. The girls set off for the campsite with clear skies ahead. It&apos;s time for Setsuna to show off what she learned from her anime!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_5", /*message*/"You&apos;ve all managed to set up the tent. Now it&apos;s time to forage for some local wildflowers, mushrooms, and fish for dinner!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_6", /*message*/"It&apos;s finally time for the highly anticipated dinner! Bounties fished up from the river and picked in the mountains, plus Lanzhu&apos;s huge stock of meat means that a fun-filled night lies ahead!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_7", /*message*/"Now that the excitement of dinnertime is over, everyone has fun talking late into the night. What happens when an insomniac Ai sneaks out of her tent?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_8", /*message*/"While the second-years&apos; passionate outdoors video is being made, the Nijigasaki promo video grows steadily closer to completion. How does it look when all those flawless clips are put into place?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_37_9", /*message*/"You can&apos;t help but feel that there&apos;s something off about the promo video, even though it&apos;s proceeding smoothly by all accounts. You can&apos;t put your finger on what&apos;s wrong until you go to thank everyone who helped work on it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_1", /*message*/"You straighten out your unsettled feelings after talking to Ayumu. You want to make the ultimate, quintessentially Nijigasaki promo video, but what happens when you try to tell the others?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_10", /*message*/"The reshoot is over and you continue to work on editing everything together with the footage from each club and association. Will you complete the unique Nijigasaki promo video that you envisioned?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_2", /*message*/"You&apos;re trying to somehow remember that perfect promo video you dreamed of. What do the third-years, who find you racking your brains, have to say?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_3", /*message*/"You take a trip to the theater with the third-years that doubles as a video shoot for the fansite campaign. Does the wonderful show send you into dreamland?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_4", /*message*/"You start to see the outline of what you really want to make after going to see the musical. Something happens when you watch some past footage to make that outline clearer.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_5", /*message*/"You can finally see the outline of what you want to make. To make it a reality, you&apos;ll have to ask each club and association again!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_6", /*message*/"Karin puts in practice for the reshooting of the dance segment. She always puts in her best for her performances, but who is her trusty companion?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_7", /*message*/"The members are reshooting the promo video. School is out today, but the members who can get together are booked in for reshoots. What do they get up to on such a fine day?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_8", /*message*/"The members are reshooting the promo video. With everyone helping each other out, the footage is steadily getting done. How will filming with Lanzhu and Mia today go?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_38_9", /*message*/"The reshoot is nearing its end, but Kanata puts the other girls first as usual. You&apos;re concerned about this, but Kanata has some ideas of her own.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_1", /*message*/"Nijigasaki&apos;s promo video, which was uploaded to the School Idol Exhibition website, has had a great impact on more than just the Nijigasaki students. What happens when you see it firsthand?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_10", /*message*/"You have finished writing the background music for the Theater Club, and the show opens today at last! What are your thoughts on the play you see before your eyes?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_2", /*message*/"Various reactions to the promo video made for the School Idol Exhibition keep coming to μ&apos;s and Aqours one after another. What are the people saying?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_3", /*message*/"Since the promo video was created, the whole of Nijigasaki has been buzzing with liveliness. What does Shioriko, as the student council president, negotiate with the school for?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_4", /*message*/"Karin&apos;s magazine has decided to publish a feature on her! It seems she was inundated with emails from readers who saw the promo video. What happens when Karin consults with you about what kind of plan to make for it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_5", /*message*/"Ai is invited to practice with the Basketball Club as they prepare for the finals of the regional tournament. What do you see when you go to watch with everyone?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_6", /*message*/"Today is the day of the School Idol Club&apos;s scheduled live show and the Basketball Club&apos;s regional tournament final. You want everyone to give their best live performance and cheer for the Basketball Club!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_7", /*message*/"Emma asks you if you are free on your next day off. She takes you to the children&apos;s center where Shioriko often volunteers.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_8", /*message*/"One day, Shizuku brings you in to help with the Theater Club! However, you get flustered by discussions of something you&apos;ve never done before.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_39_9", /*message*/"The Theater Club president asks you to create background music for their next performance. While you are fumbling your way through it for the first time, you are invited to stay over and write your music.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_1", /*message*/"You&apos;ve come to Numazu to look into Aqours&apos; secret. However, since you&apos;ve come on a whim, you realize you don&apos;t know where to go to meet them. For now, you just decide to go to their school, Uranohoshi Girls&apos; High School.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_10", /*message*/"Ruby and Hanamaru&apos;s tourism guide is polished up and truly shows the appeal of Numazu. You watch their dance lesson, and during a break you find Dia intently writing something in a notebook. What could it be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_2", /*message*/"You&apos;ve come to Numazu with no plan. Even after asking around the school, no one seems to know where Aqours is, so you&apos;re running out of steam. You follow some advice that since you&apos;ve come this far, you should go see the ocean.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_3", /*message*/"You find Riko at the beach, and after telling her you came all this way to find out Aqours&apos; secret, she kindly brings you to Chika&apos;s place. Another Aqours member, You, is there and they had been discussing the Summer Festival.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_4", /*message*/"You ask Chika and You about the secret to Aqours&apos; performance. It turns out they&apos;re looking for the same thing you are, so you think about why everyone shines. The next day, Chika brings you to meet Mari, Dia, and Kanan.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_5", /*message*/"After speaking with Mari, you decide to help out in the Summer Festival. Next, you go visit the freshmen who are busy with preparations. You hear the cheerful voices of the three of them in the room, when...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_6", /*message*/"Just like Chika and the others, the three girls you meet, Yoshiko, Ruby, and Hanamaru are seeking their own way to shine. Aqours has members peculiar enough to rival even Nijigasaki. That night, they hold a welcome party for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_7", /*message*/"Aqours seemed out of your league, but you see they love school idols, too. You beg them to let you help with the festival. The next morning, as you walk along the ocean road, you run into Mari and Kanan out for an early workout.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_8", /*message*/"You&apos;re exhausted from training with Mari and Kanan. Aqours is the real deal. You head to the kitchen to help You and Yoshiko with making samples of food for the festival, when suddenly you hear a terrible scream from inside!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_3_9", /*message*/"You feel relieved after Yoshiko&apos;s menu suggestions become a bit more normal. You help Ruby and Hanamaru with the Numazu tourism guide next. Hanamaru&apos;s vast knowledge really throws you for a spin.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_1", /*message*/"Aqours are preparing for their live show in Numazu, and they have started working on a pamphlet to hand out to everyone who comes to watch their show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_10", /*message*/"After Kaoruko listens to you, you calm down a bit. One nap later, you finally arrive in Numazu! After a shower and some breakfast, your mind is now occupied with the live show!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_2", /*message*/"You&apos;ve been feeling a bit gloomy lately and have had trouble going to bed and getting up on time. Ayumu comes to wake you up and head to school with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_3", /*message*/"One day after school, Kanata asks you to taste test something. What has she whipped up this time?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_4", /*message*/"The time has finally come for Aqours&apos; live show! It&apos;s this weekend! Everyone is talking about where to meet up in the morning when Kaoruko shows up with a plan.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_5", /*message*/"Tonight&apos;s the night you finally leave for Numazu. Kaoruko picks up Shioriko and the dorm girls and then heads to the apartment complex where you and Ayumu live. Now it&apos;s time to get everyone else, one by one!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_6", /*message*/"The minibus makes a stop at a service area for a break. Everyone is curious to see what a service area is like at night... What kind of stuff do they have there, anyway?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_7", /*message*/"After enjoying it to the fullest, the School Idol Club members leave the service area. Back on the minibus, a game of Q&amp;A sparks some lively conversation.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_8", /*message*/"The hour grows late. All of the girls were chatting cheerfully, but now they&apos;re fast asleep. You find yourself alone, unable to get any rest. Kaoruko notices and asks you a question.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_40_9", /*message*/"Kaoruko senses that you&apos;re feeling uncertain and chooses to share her own experiences with you. How will you feel after hearing her out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_1", /*message*/"Arriving at Aqours&apos; live show venue, the gang notices that a lot of Aqours fans have already gathered there. Feeling the passion of the fans who came from afar to see the show, everyone&apos;s hype only grows more intense!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_10", /*message*/"At the service area, you come up with a hook for the new song&apos;s chorus. After you put it into the songwriting app, the song is now complete. You hope that it is a melody that everyone will want to sing right away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_2", /*message*/"The girls observe Aqours&apos; rehearsal. They see and notice how uncompromising Aqours are right before a live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_3", /*message*/"The Aqours live show has finally begun. In front of a packed venue full of fans, Aqours unleash a spirited and powerful performance!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_4", /*message*/"The Aqours live show is drawing to a close. As the new fans from all over Japan and the ever-loyal local fans come together as one, the excitement continues to climb.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_5", /*message*/"Aqours have completed another successful live show. They gather in Tochiman along with μ&apos;s and Nijigasaki and throw themselves a big after-party!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_6", /*message*/"The after-party at Tochiman heats up. After getting fired up by Aqours&apos; performance, the members of Nijigasaki and μ&apos;s start chatting away about all the things they want to do next. Meanwhile, you go outside to get some fresh air.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_7", /*message*/"You&apos;re down in the dumps, feeling like you are the only one who has nothing to offer. Even on the minibus ride home, your mood doesn&apos;t improve.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_8", /*message*/"You let out all of the anxiety and negative feelings that have been bothering you for so long. After learning of your true feelings, the School Idol Club members embrace you with kindness.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_41_9", /*message*/"Your minibus ride is going smoothly, with Tokyo just right around the corner. Before you get there, however, you all make a stop at a service area for one last break. Enjoy it and relax to the max!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_1", /*message*/"Honoka is back from Numazu. She thinks back on the fun conversation she had with the Aqours members who walked her to the station.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_10", /*message*/"After Honoka and Nico&apos;s small argument at the quiz show wrap-up party, Nico ends up blaming herself. However, there&apos;s still something she has to get across. How exactly does she feel?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_2", /*message*/"Honoka ends up sleeping late with her head wrapped up in the Aqours live show. She bursts in just before morning practice starts, but what&apos;s going on with Nico?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_3", /*message*/"Umi and Kotori gather at Honoka&apos;s house after practice. They&apos;re supposed to be preparing for the test, but will they actually?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_4", /*message*/"Eli, Nozomi, and Nico take a detour after practice. They couldn&apos;t decide what to do to shock the world during club time, so they chat about it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_5", /*message*/"μ&apos;s agree to take part in a magazine&apos;s feature on school idols. Now, the day of the interview and photoshoot is finally here.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_6", /*message*/"The magazine&apos;s feature on school idols with μ&apos;s has been published. Through their photoshoot and interview, they&apos;ve promoted their appeal as school idols, but what will that lead to?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_7", /*message*/"After the magazine feature, μ&apos;s receive an offer from a TV station to appear on their quiz show. Can they win and shock the world with their victory?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_8", /*message*/"Honoka, Nico, and Maki are chosen to represent μ&apos;s on the quiz show, and the three give it their all! So, how did they do?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_42_9", /*message*/"Honoka and Nico get into a small argument at the wrap-up party following the recording of the quiz show. What does Honoka have to say after giving Nico&apos;s comments some serious thought?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_1", /*message*/"After a grueling schedule of magazine and TV show appearances, μ&apos;s is finally getting a brief respite. How will they spend their time?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_10", /*message*/"Honoka and μ&apos;s have a new plan and a new goal. They go on a trip to thank Aqours for giving them the initial inspiration.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_2", /*message*/"μ&apos;s start an intense training regimen so they can improve enough to impress the world. Where can a wiped-out Honoka go to relax and recharge?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_3", /*message*/"Honoka and Umi go to the maid café to unwind, then take a walk around town with Kotori after she finishes her shift. How have things changed in the area since the last time they went out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_4", /*message*/"Honoka feels sad when she notices how the town she once knew so well has changed. Will Akihabara change beyond recognition?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_5", /*message*/"After an impromptu performance on the streets of Akihabara, Honoka finally understands how Nico feels. Meanwhile, Nico starts feeling anxious about the recent mood in the club.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_6", /*message*/"Honoka and μ&apos;s decide to keep changing and evolving to create something that will last forever. Time for a group meeting to figure out their next exciting challenge!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_7", /*message*/"Honoka and Nico make it clear they want μ&apos;s to keep evolving and achieve even greater accomplishments, but can the first-year trio keep up with the pace set by the older girls?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_8", /*message*/"The first-year girls simply can&apos;t keep up with the rest, and Honoka knows it. She comes up with the idea to try and explain how she feels with a song.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_43_9", /*message*/"Honoka, Umi, and Kotori create a song to express how they feel. What will Honoka pick for its title?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_1", /*message*/"Rina takes part in a plethora of fan club activities online, connecting with her fans in ways only she can. You end up staying up all night having fun at her game event too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_10", /*message*/"The words &quot;cheering is pointless&quot; have made you curious. However, you don&apos;t have time to worry about that, because the High School Game Creator Contest is tomorrow!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_2", /*message*/"A career path survey is distributed to the entire school. You head to the clubroom with your head full of unformed thoughts, where Rina asks you for some advice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_3", /*message*/"Rina decides to take part in the High School Game Creator Contest and invites you to join her team. Unsure if you have much to offer, you hold off on your response.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_4", /*message*/"Rina, Setsuna, Mia, and you decide to take part in the High School Game Creator Contest. But first, it&apos;s time to study up on the wide world of video games!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_5", /*message*/"Karin isn&apos;t sure what to write on her career path survey, being stuck writing things down and erasing them over and over again. How can she pull herself out of this predicament?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_6", /*message*/"In preparation for the High School Game Creator Contest, you do some personal game research. You decide to look into gaming trends and ask Honoka, Kotori, and Umi for their thoughts.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_7", /*message*/"Preparations for the High School Game Creator Contest seem to be progressing well. Meanwhile, in the dorms, Emma is busy giving all sorts of excessive help. You ask what everyone&apos;s plans are for the day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_8", /*message*/"The career path survey encourages the Nijigasaki girls to undertake new challenges. However, Kanata seems to have some worries about her future.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_44_9", /*message*/"It&apos;s time for Nijigasaki&apos;s scheduled live show! Even though some of the members didn&apos;t have enough time to practice the things they wanted to do, the school idols have been getting ever more excited after making the promo video!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_1", /*message*/"You&apos;re all getting ready for the High School Game Creator Contest tomorrow. You spend the day before it in high spirits, reviewing the rules, getting supplies, and taking a slight detour to enjoy yourselves.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_10", /*message*/"The High School Game Creator Contest was a new challenge for Rina. You all took it on, never gave up, and ended up making what she had envisioned. So, what do the judges think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_2", /*message*/"With support from the clubs that helped with the Nijigasaki Film Festival, you couldn&apos;t be more ready to take on this contest. Speaking of which, today&apos;s the day!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_3", /*message*/"You&apos;re given the theme for this game contest—dreams. The girls dream that the school idol songs that they poured their heart and soul into will reach more people. Make that dream come true by creating a rhythm game!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_4", /*message*/"You and the girls go out to get some dinner. What awaits you when you head to the usual spot to quell Mia&apos;s hunger for burgers?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_5", /*message*/"The game is coming along nicely. In fact, you&apos;re getting it done quicker than you expected. However, you notice something off about Rina, who seems to have become lost in her work.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_6", /*message*/"It turns out that Rina had another game that she really wanted to make. What do you do after you hear what she has to say?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_7", /*message*/"After hearing Rina&apos;s concept for what she&apos;d like to make, you and the girls decide to work on a falling object puzzle game. How will you all deal with working under such time pressure?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_8", /*message*/"Reaching the home stretch, you decide to take turns getting some rest. You head to the nap room with thoughts of what&apos;s to come running through your head when you&apos;re caught off guard.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_45_9", /*message*/"The night ends quickly as you find yourself at the final stretch. You each continue with your respective duties, but will you finish on time?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_1", /*message*/"You finally catch your breath after finishing the Game Creator Contest in one piece when Karin asks you to accompany her to a photoshoot. Feeling it&apos;s unusual for her to ask, you decide to go with her. What&apos;s different this time?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_10", /*message*/"Kanata and Tsumugi delight in winning the National No1 High School Pâtissier Contest&apos;s grand prize with their Macaron of Support, and today&apos;s party to celebrate has a surprise in store.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_2", /*message*/"The School Idol Club members have their sights set on the future. Seeing this, Kanata is filled with a new determination to devote herself to making a new recipe that will bring her success at the High School Pâtissier Contest.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_3", /*message*/"After hearing Tsumugi&apos;s story, Kanata feels at a loss. Not knowing what to say to Tsumugi, her worries continue to gnaw at her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_4", /*message*/"Today&apos;s joint live show is a bit out of the way! Lots of fans who found out about the girls from their other activities are there to watch, which gets everyone all fired up. Welcome to the Nijigasaki live show!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_5", /*message*/"You manage to stop Tsumugi just as she is about to leave the venue. The conversation that follows reveals more about her past.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_6", /*message*/"You hear what happened to Tsumugi, and it&apos;s a complex situation without an easy fix. Despite that, you just cannot accept that supporting someone is inherently bad. You&apos;ll have to figure out your thoughts on this tricky matter.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_7", /*message*/"Kanata decides to put on a live show to get her feelings across to Tsumugi. With the preparations all in order, the live show is about to begin!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_8", /*message*/"Kanata&apos;s live show has made Tsumugi take on baking once again, and she agrees to join the National No1 High School Pâtissier Contest. What happens to you after seeing Kanata stand up and successfully convey her feelings?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_46_9", /*message*/"Kanata and Tsumugi settle on making the macarons from their past in the National No1 High School Pâtissier Contest. Now that the big day is finally here, can they truly recreate the macarons just as they remember them?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_1", /*message*/"Everyone has taken up new challenges in the wake of the career path survey. Fueled by their new passions, everyone is also enthusiastic about club practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_10", /*message*/"You notice a perspective that you were missing during your conversation with Ayumu. Just the next morning, you start discussing it with everyone after they have all gathered together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_2", /*message*/"Shioriko, who has been tasked with making a pamphlet about Nijigasaki, wants to make something that can only be made now, putting the best of the school front and center for all to see. How will the other girls react?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_3", /*message*/"After consulting with Shioriko, the club decides to help create the school pamphlet for Nijigasaki. Time to take a walk around the school and figure out what makes it so great!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_4", /*message*/"As you walk around Nijigasaki searching for its charms, you realize all over again how nice of a school it is. When you talk about it with Ayumu, you recall the day of your own entrance ceremony.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_5", /*message*/"The search for Nijigasaki recommendations continues. Where will everyone choose to go after talking it over?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_6", /*message*/"The members of the School Idol Club talk passionately about Nijigasaki&apos;s cafeteria. After school, Kasumi and Shizuku go shopping.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_7", /*message*/"You&apos;ve just about got all of the school recommendations sorted, but you take a moment to pause before handing them over to Shioriko.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_8", /*message*/"You and Setsuna go to the student council room to help out with student council business, only to find that no one is there.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_47_9", /*message*/"The club members have been looking for good things to write about Nijigasaki over the past few days and have been reminded how wonderful a place it is. They now think they can make a pamphlet that will make people want to enroll.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_1", /*message*/"You noticed that your school&apos;s brochures don&apos;t have a lot of concrete info on the various subjects it offers. When you mentioned that, it was like a light bulb went off in Shiriko&apos;s mind.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_10", /*message*/"The School Idol Club members are enjoying their individual experiences with the Try New Electives Program. Ai is particularly jazzed, attempting to take them all on, when she hears that Misato has been hospitalized.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_2", /*message*/"Shioriko proposed a Try New Electives Program. You have to create a proposal statement for this plan to go through. What would make for an engaging program experience?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_3", /*message*/"On your way to the clubroom, you happened to notice Shizuku deep in conversation with a classmate.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_4", /*message*/"Kasumi and Rina applied for the international exchange elective program. They decide to ask Mia for help in brushing up on their English before they go.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_5", /*message*/"Kasumi and Rina begged Mia for help. Now armed with their new English prowess, the girls are off to try the international exchange course!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_6", /*message*/"Kasumi and Rina soon realize just how amazing Shizuku is once they give the international exchange course a whirl. Now they want to know what led Shizuku down this path in the first place.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_7", /*message*/"One morning during class, Karin seems awfully sleepy. Her modelling work has been keeping her quite busy recently.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_8", /*message*/"Today&apos;s the day where you&apos;ll be trying the life planning course. What sort of adventures will that bring?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_48_9", /*message*/"The life planning course has you remaking secondhand clothes. Emma, Lanzhu, Karin, and Kanata work together to make an outfit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_1", /*message*/"You&apos;re walking along to pick up lunch when you happen to spot Ai running past in a big hurry. What&apos;s she up to?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_10", /*message*/"You and Ai go to the hospital to visit Misato. Ai&apos;s a big hit with all the patients, and she somehow winds up putting on a miniature concert for them. When you&apos;re both tired and it&apos;s time to walk home, what do you talk about?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_2", /*message*/"Ai&apos;s here to try the music department, and while she looks nervous, that clearly won&apos;t stop her excitement. How will the program turn out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_3", /*message*/"And thus ends the program to try out different departments in order to fill the school pamphlets with everything wonderful about Nijigasaki. Mifune interviews everyone who took part.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_4", /*message*/"Once the post-program interviews are over, everyone is about to head home. Just then, you notice Fishpuff doing something odd.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_5", /*message*/"Chasing Fishpuff leads you all around town through streets you normally never take and to places you&apos;ve never been. When Fishpuff, tired of all the walking, settles down for a nap, you decide to take a break too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_6", /*message*/"You have one surprise after another as Fishpuff&apos;s solo tour takes her around town to be doted on by all the townsfolk. Now where&apos;s Fishpuff off to next?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_7", /*message*/"Ai wastes no time before telling Misato all about Fishpuff&apos;s big adventures. Unfortunately, the hospital lights-out time cuts her short.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_8", /*message*/"After you give Ai the chord progression data, Ai says she wants to learn more about music. Is she going to attempt to compose a song too?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_49_9", /*message*/"You head out for a shopping trip, and as you wander around town, errands complete, you happen to bump into Ai.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_1", /*message*/"After seeing the detail with which Dia records Aqours&apos; activities, you decide you want to do the same for Nijigasaki. You spend your time productively, and before you know it the festival is only a week away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_10", /*message*/"In the end, it seems that yet again they didn&apos;t find their shine like Chika had talked about. It is only you that may have barely grasped what it is, and with that you leave Numazu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_2", /*message*/"You take on secretarial duties for the Summer Festival, but something about Chika&apos;s behavior that day catches you off guard. Then you run into Riko, who just so happened to sense the same thing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_3", /*message*/"Chika returns to normal after being able to crank out the new lyrics she had been worried about. The festival is tomorrow, and the tension in the air is electric.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_4", /*message*/"The night before the festival, you have fun sharing secrets with Chika who has snuck to your room. You start to feel &quot;that special something&quot; so important to school idols. Now, it&apos;s the big day, but Numazu&apos;s skies are very dark.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_5", /*message*/"The first day of the festival is canceled by a typhoon. Still keeping hope for the next day, you and Aqours make ten teru teru bozu dolls. Will your prayers get through?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_6", /*message*/"It&apos;s the second day of the festival, and although the sun shines, the storm has scattered branches and garbage all over town, so the Festival Committee has decided to cancel today as well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_7", /*message*/"Chika won&apos;t give up on the festival, and everyone in Aqours feels the same. Will the last-ditch effort to clean the town really work?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_8", /*message*/"Mari convinces the Festival Committee to retract the cancellation! Thanks to your announcement on the town P.A., locals and even tourists help Aqours with town cleanup.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_4_9", /*message*/"The festival turns out to be a huge success. Aqours overcomes hardship and puts on a wonderful show for everyone. At the after party with the still-excited members, you ask Chika about something she said the first day you met her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_1", /*message*/"Ai is gripped by an unclear, whimsical feeling after visiting Misato. Maybe your advice can help her understanding what she&apos;s grasping at?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_10", /*message*/"With the help of the School Idol Club, the Student Council has finally finished the Nijigasaki school pamphlet. The School Idol Club take a look at the mountain of information inside that shows off the appeal of Nijigasaki.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_2", /*message*/"The world Ai wants to someday make is similar to the metaverse. But she doesn&apos;t really have a good grasp on what the metaverse is. She decides to experience that world through games.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_3", /*message*/"The girls play an MMORPG as a way to familiarize themselves with the metaverse. Though it seems hard, with Rina and Mia&apos;s help, everyone ends up thoroughly obsessed.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_4", /*message*/"Even during club hours, the School Idol Club members spend their time talking about the game. During the conversation, Ai has new thoughts about a certain idea.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_5", /*message*/"The Nijigasaki students are obsessed with the MMORPG. What will tonight&apos;s adventure be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_6", /*message*/"Ai and the others have gotten used to the game world. They decide to take a tablet to the hospital and help the patients their to experience the game for themselves.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_7", /*message*/"The patients didn&apos;t quite respond to the MMORPG as Ai had hoped. Why, when she really thought they&apos;d enjoy it? Troubled, Ai searches for an answer.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_8", /*message*/"After talking to Misato, Ai begins to understand the kind of world she wants to create. What will happen when she tells the School Idol Club about it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_50_9", /*message*/"After talking to the School Idol Club, Ai has a strong grasp on exactly what her aims are. How will the hospital patients respond when she explains her new idea?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_1", /*message*/"The Nijigasaki girls have gotten μ&apos;s and Aqours into playing MMORPGs. Tonight, a large group of them will band together and set off on an epic quest.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_10", /*message*/"Once again, it&apos;s become clear to you that Odaiba is where you belong, mind, body and soul. What fresh new discoveries await you after spending the day exploring and enjoying the sights?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_2", /*message*/"All the Nijigasaki members have been invited to a festival where μ&apos;s are set to perform. Once they start swapping stories about their hometown festivals, the excitement hits a fever pitch!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_3", /*message*/"The long-awaited day of the festival is finally here! μ&apos;s have come to Akihabara Station to pick up the Nijigasaki gang and Aqours. They head to Kanda Shrine while sharing their favorite memories of the festival!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_4", /*message*/"Everyone&apos;s enjoying their time at the Daikoku Festival. You&apos;re constantly being bombarded by the tempting aromas wafting around you. But what happens when Lanzhu notices a sign advertising an ice water endurance challenge?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_5", /*message*/"You&apos;ve enjoyed the first day of the Daikoku Festival to the absolute fullest. Now it&apos;s time to get some quality rest before the μ&apos;s performance tomorrow... At least, that was the plan!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_6", /*message*/"It&apos;s the second day of the Daikoku Festival! Everyone wakes up, rubs their sleepy eyes after the late-night pillow fight, then heads to the festival grounds together. On today&apos;s agenda is learning about a traditional ceremony.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_7", /*message*/"The festival is drawing to a close, and everyone is having the time of their lives. Any minute now, μ&apos;s performance is set to begin!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_8", /*message*/"The Daikoku Festival has come to an end. Everyone returns home exhausted, elated, and just a little bit sad it&apos;s all over. Who will be waiting for them when they get home?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_51_9", /*message*/"Everyone is still full of excitement from the trip. As the Nijigasaki girls talk about the past few days, they suddenly realize that Odaiba has no traditional festivals of its own. Why is that, anyway?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_1", /*message*/"After parting with Aqours, you return to Nijigasaki for the first time in a while and see how everyone has improved. You&apos;re very happy, but next you want to go meet μ&apos;s.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_10", /*message*/"The third is a vocal contest between Umi and Shizuku! Shizuku&apos;s singing is amazing thanks to her practiced expressiveness, but Umi&apos;s score is higher after turning up the heat. Nijigasaki takes in the current score on the board.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_2", /*message*/"You&apos;re chosen to go interview μ&apos;s through a lottery on their fan site, so you take your excitement over to Otonokizaka High. μ&apos;s are very friendly and you&apos;re looking forward to the interviews, but who will you interview first?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_3", /*message*/"Your first subjects are Honoka, Umi, and Kotori. As they start to discuss the next big show, you wonder what kind of detailed planning they&apos;ll undertake, but the reality surprises you. Confused, you visit the freshmen next.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_4", /*message*/"Next you interview Rin, Maki, and Hanayo. They let you sit in on Maki composing at the piano while Rin and Hanayo cheer with maracas. You are a bit taken aback by their relaxed songwriting, but go on to the next interview.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_5", /*message*/"You hear from Eli, Nozomi, and Nico last. No matter what they say, they take care of their underclassmen. Wanting to see them outside of idol activities, you watch Eli and Nozomi make good use of Nico for the student council.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_6", /*message*/"After the interviews, μ&apos;s throws you a welcome party. You share how the joint performance they did with Aqours made you fall in love with school idols, and that&apos;s how you joined Nijigasaki High School&apos;s school idol club. Then suddenly Nico...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_7", /*message*/"You return to Nijigasaki High School and inform everyone of their nine battles with μ&apos;s! Everyone is surprised, but they are excited that if you win, you&apos;ll get the secret idol handbook. Everyone is determined to win and get it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_8", /*message*/"The members are moved by meeting μ&apos;s, but it&apos;s time to start the battle! Up first is a gyoza eating contest between Emma and Hanayo, each adding rice or bread. Emma ekes out a win and they become friends! Now on to the next one!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_5_9", /*message*/"The nine school idol contests! The second is Eli VS Karin in a dance off at an arcade! The scores are even, but the audience cheers louder for Eli. Karin is disappointed by the difference between her and Eli.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_1", /*message*/"You thought maybe Nijigasaki could win with all the hard practice, but things won&apos;t be that easy. Time to take a deep breath and get ready for the remainder of the nine contests!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_10", /*message*/"You work tirelessly on your song, making countless mistakes until you write something that can defeat μ&apos;s, but you despair hearing Maki&apos;s song at the event. It is a song only for μ&apos;s, but yours doesn&apos;t evoke its singers.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_2", /*message*/"Kanata wins the test of courage by falling asleep! The score is two-and-two now. Nico doesn&apos;t seem to like everyone getting along in these intense battles. There must be more suspense!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_3", /*message*/"Ai wins the stamina contest by keeping her own pace. Rin, even after losing from burning out in the rush of her runner&apos;s high, seems satisfied. What will the next contest be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_4", /*message*/"The music knowledge contest was in fact a school idol song intro quiz. Maki, thinking it was a musical history test, had no chance against Setsuna, who got even the most obscure songs right away. Even Nico looked impressed.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_5", /*message*/"The seventh contest of costume choice goes to Kotori, who knows her members&apos; charms better than anyone! Rina tries her best to give everyone their own special Rina-chan Board, but maybe her approach is too quirky!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_6", /*message*/"Ayumu does her best with the animals, but they chase Honoka without her doing anything, resulting in her victory. Now it&apos;s even at four-and-four! The final contest is Nico VS Kasumi in an idol-off! Who will earn the victory?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_7", /*message*/"Despite Nico having the game in her hands, it ends in a tie. This doesn&apos;t sit well with either of them, but that&apos;s the contest. 4-4-1 is the final result, so can Nijigasaki get that idol handbook?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_8", /*message*/"Nico offers the secret idol handbook as a token of a well-fought battle, but you say you can&apos;t take it. Nozomi suggests a new contest to give you the chance to take it fair and square, but what is it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_6_9", /*message*/"The tenth contest is a songwriting competition between you and Maki for an event at the end of the month. You promise to write the best song for Nijigasaki after their hard work, and the μ&apos;s members assist Maki in her writing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_1", /*message*/"You&apos;re down in the dumps after the song-writing contest. You keep asking yourself what was missing from your song as you go to an event μ&apos;s is doing. Seeing the performance, everyone is excited but you, which causes some worries.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_10a", /*message*/"The venue planned for the School Idol Festival is unavailable due to the Olympics! However, wanting everyone to hear your new song, you put together an impromptu show in the auditorium. μ&apos;s and Aqours come and hear the new song.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_10b", /*message*/"μ&apos;s and Aqours watch from the sidelines as the Nijigasaki High School Idol Club lights up the stage in a spectacular show. For some reason, they seem so restless!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_2", /*message*/"You can&apos;t keep feeling down about your shortcomings, and you decide you&apos;re going to aim even higher. Then, Chika calls you after hearing about your loss. After talking with her, you decide to call Maki.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_3", /*message*/"After talking with Maki like Aqours suggested, you are invited to go to Homura Bakery. There, talking with μ&apos;s, you realize you were just thinking of beating μ&apos;s rather than about the girls at Nijigasaki when you wrote your song.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_4", /*message*/"Seeing everyone is worried about you, you tell them how you met with μ&apos;s and realized exactly where you went wrong. You promise that next time, you&apos;ll think of everyone when you write your song.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_5", /*message*/"In order to get to know Ai, Kanata, and Rina better, you go with them to Harajuku to hang out. You buy clothes at a used clothes store, eat crepes and cream puffs, and spend some fun time together like typical high school girls.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_6", /*message*/"Kasumi, Ayumu, and Emma are jealous you went to Harajuku without them, so you have a relaxing pajama party. You watch an old video that Emma treasures, and Kasumi is jealous as you reminisce about old times with Ayumu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_7", /*message*/"On Karin&apos;s suggestion, you and Shizuku try to find out Setsuna&apos;s secret. It&apos;s...watching anime?! Karin and Shizuku aren&apos;t impressed at first, but Setsuna&apos;s fiery explanations make them realize the power that such passion can hold.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_8", /*message*/"After spending more time with everyone at Nijigasaki, you&apos;ve gotten to know them better. Hearing everyone&apos;s story, you&apos;re ready to make a new song for them, and they sure seem to be quite excited about that prospect.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_7_9", /*message*/"After hearing your new song, everyone relates to it in their own way and feels like it&apos;s &quot;their&quot; song. Despite finally making a song just for Nijigasaki, you receive an email saying the School Idol Festival is canceled.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_1", /*message*/"To the surprise of all, the dream joint-show with μ&apos;s, Aqours, and Nijigasaki has become a reality--one far more radiant than you had imagined. You want more people to see your friends shine, leading you to a big decision!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_10", /*message*/"With Kaoruko&apos;s support, the members decide to take over as the School Idol Festival Planning Committee. Having the experienced Aqours and famous μ&apos;s is reassuring. Right when morale is high, however, there&apos;s a knock at the door!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_2", /*message*/"You steel yourself and call the head of the School Idol Festival Planning Committee. Unfortunately, the Olympics aren&apos;t the only reason it&apos;s been canceled. Then, Honoka calls to see if everyone can gather on the weekend.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_3", /*message*/"The union of the three groups redoubles their desire not to give up. After researching old information and resolving to contact Kaoruko, it&apos;s time to head home from school. The girls split into different groups to go hang out.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_4", /*message*/"Honoka and Chika spend the night at your house, and you take the chance to chat about your love for school idols. You go on late into the night, but what have the other members been doing in the meantime?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_5", /*message*/"Riko, You, Kotori, Umi, Ayumu, and Kasumi are chatting away about people they love that happen to be a handful. Meanwhile, Dia and the others are in a karaoke room.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_6", /*message*/"Ruby, Hanayo, Nico, Setsuna, and Emma have a competition to see who knows school idol songs the best, with Dia and Kanata as judges. As the fierce competition rages, what is happening outside the karaoke room?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_7", /*message*/"Rin, Nozomi, Hanamaru, Yoshiko, Ai, and Rina come to Harajuku, the town where &quot;fallen angels gather,&quot; according to Yoshiko. Ice cream, crepes, book shops, shoes--they&apos;re having a great time in town. Meanwhile, in Odaiba...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_8", /*message*/"The group in Odaiba goes shopping, bowling, and to the hot springs. Everyone thoroughly enjoys their Saturday. The following morning, you happen to wake up early. You go out onto your balcony only to find Ayumu on her&apos;s next door.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_8_9", /*message*/"After getting a message from Kaoruko and speaking to Ayumu under the morning sun, your resolve strengthens. Then, when you let everyone know of her message and your determination...");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_1", /*message*/"Setsuna has taken over the reins of the School Idol Festival committee, but just before she starts, she is challenged by Shioriko Mifune. Despite their surprise over the re-election, the members start by looking into Shioriko.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_10", /*message*/"Setsuna takes on the re-election alone. While her speech and plans are more convincing than ever, the vote count crowns Shioriko as the new council president. All you and the others want to do now is be by Setsuna&apos;s side.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_2", /*message*/"The club has looked into Shioriko. She is the calm, well-behaved, academically-gifted, flawless daughter of the wealthy Mifune family. You must tell μ&apos;s and Aqours about Setsuna&apos;s student council election at the weekend gathering.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_3", /*message*/"The members have decided to support Setsuna&apos;s re-election campaign while working towards holding the Festival. You are unanimously elected to be the committee head. Amongst this, Setsuna is concerned by Shioriko&apos;s behavior.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_4", /*message*/"Setsuna divulges her feelings to you and also seeks the advice of Eli and Dia. She has found what she needs to do for re-election and is feeling more positive. However, Shioriko increases the reach of her activities.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_5", /*message*/"μ&apos;s and Aqours send messages and gifts of support to Setsuna, who is mentally weakened by Shioriko&apos;s extra push. Despite everyone&apos;s support, she cannot hide her worry. The Festival preparations start becoming more serious as well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_6", /*message*/"Setsuna is feeling the pressure of the re-election and her School Idol Festival committee duties. While she is burdened by the weight of her complicated feelings, the day of her public debate against Shioriko arrives.");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_7", /*message*/"Shioriko&apos;s proclamation that Setsuna&apos;s words have no power at the moment pierces her deep in the heart. She has a goal as the student council president, but it isn&apos;t her greatest desire. What exactly does she truly wish for?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_8", /*message*/"Setsuna announces her withdrawal from the School Idol Club because she feels as though her presence is a burden to everyone. What do μ&apos;s and Aqours do when they learn of this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"story_main_summary_9_9", /*message*/"Everyone&apos;s support leads you to have a heart-to-heart with Setsuna. However, Setsuna is set in her ways and won&apos;t cooperate. Perhaps all you can do is watch over her as she battles it out alone. The day of the re-election is nigh.");
